import './App.css';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom'
import Index from './Pages/Home/Index';

function App() {
	return (

		<>
			<Router>
				<Routes>
					<Route path="/home" element={<Index />}></Route>
				</Routes>
			</Router>
		</>
	);
}

export default App;
